import logo from '../assets/photo.jpg';
import logo1 from '../assets/photo.jpg';
import logo2 from '../assets/photo.jpg';
import logo3 from '../assets/photo.jpg';
import logo4 from '../assets/photo.jpg';
//import '../components/GallerData.css';
const GalleryData = () => {
    return ( 
        <>
            <nav className="navbar">
            <span class="item active" data-name="all">All</span>
         <span class="item" data-name="rose">rose</span>
        <span class="item" data-name="jasmine">jasmine</span>
        <span class="item" data-name="lotus">lotus</span>
        <span class="item" data-name="sunflower">sunflower</span>
        <span class="item" data-name="daisy">daisy</span>
            </nav>
<h1>Image Gallery</h1>
        <div className="gallery">
            
            <div>
            <img src={logo} alt="Logo" className="navy" />
            </div>
            <div>
            <img src={logo1} alt="Logo" className="navy" />
            </div>
            <div>
            <img src={logo2} alt="Logo" className="navy" />
            </div>
            <div>
            <img src={logo3} alt="Logo" className="navy" />
            </div>
            <div>
            <img src={logo4} alt="Logo" className="navy" />
            </div>
        </div>
</>
     );
}
 
export default GalleryData;
